CREATE DEFINER=`root`@`localhost` PROCEDURE `get_Login` (IN `_Email` VARCHAR(50))  SELECT IdUsuario, Password, Avatar, TipoUsuario, CONCAT(Apellido, ' ', Nombre) AS Nombre FROM usuarios U
INNER JOIN tipos_usuario TU ON U.IdTipoUsuario = TU.IdTipoUsuario
WHERE Email = _Email AND Valido = TRUE$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `get_Login_Municipalidad` (IN `_Email` VARCHAR(50), IN `_Password` VARCHAR(100))  SELECT IdMunicipalidad, RazonSocial FROM municipalidades WHERE
Email = _Email
AND Password = _Password
AND Valido = TRUE$$

