CREATE DEFINER=`root`@`localhost` PROCEDURE `get_Municipalidades` ()  SELECT M.IdMunicipalidad, RazonSocial, Direccion, CONCAT(Apellido, ' ', Nombre) AS Alcalde FROM municipalidades M
